On entend par véhicule spatial ou astronef ou spationef un véhicule permettant de se déplacer dans l'espace ou d'y accéder depuis la surface d'un corps céleste. Un véhicule spatial peut être habité ou inhabité. Les véhicules spatiaux sont conçus pour une variété de missions qui peuvent inclure des communications, l'observation de la Terre, la météorologie, la navigation, l'exploration planétaire, le tourisme spatial, ou des missions à caractère militaire (espionnage, défense ou attaque). Dans la science-fiction, les véhicules spatiaux sont souvent appelés vaisseaux spatiaux. Les véhicules spatiaux existants sont les : 
*  satellites artificiels ; 
*  fusées spatiales :  
*  sondes spatiales ; 
*  capsules spatiales ; 
*  navettes spatiales ; 
*  stations spatiales.
